const initialState = {
  createOwner: [],
  restaurantDetails: [],
  menu: []
};

const ownerReducer = (state = initialState, action) => {
  switch (action.type) {
    case "CREATE_OWNER":
      return {
        ...state,
        createOwner: action.payload
      };
    case "RESTAURANT_DETAILS":
      return {
        ...state,
        restaurantDetails: action.payload
      };
    case "MENU":
      return {
        ...state,
        menu: action.payload
      };
    default:
      return state;
  }
};

export default ownerReducer;
